Fifty-nine starry flowers and 58 buds on four 54-cm arching inflorescences;

sepals and petals cream saturated cordovan, darker veins, light yellow picotee;

lip cream, overlaid and spotted light cordovan basally, saturated dark burgundy apically, white picotee, keels yelow;


column cream overlaid dark burgundy basally, anther cap white overlaid cordovan;
substance firm; texture matte.
